import axios from 'axios';
import React, { useEffect, useState } from 'react';

function Home(props) {
    const [data,setData] = useState([])
    const fetchApi = async ()=>{

        const data =await axios.get
        ("https://youtube.googleapis.com/youtube/v3/videos?part=player&chart=mostPopular&maxWidth=200&key=AIzaSyDGfgHu5xMnVzAtjs1bYgWGYYUF6yA8dXg")
        setData(data.data.items.map(e=>"https://www.youtube.com/embed/"+e.id))

        //  setData(data.data.items[0].player.embedHtml)
    }
    useEffect(()=>{
        fetchApi()
    },[])

    return (
        <div>

    <div></div>
        {data.map((e,i)=>(


            <div >
            <iframe width="400" height="213"
            src={e}
            frameborder="0" allow="accelerometer; autoplay; 
            clipboard-write; encrypted-media; gyroscope;
            picture-in-picture" allowfullscreen> 
            </iframe></div>



        ))}




        </div>
    );
}

export default Home;
